from unittest import TestCase, main
import matplotlib

from skbio.util import get_data_path

from phylofiller.rna import read_dotplot, dotPlot


def dpElements(fig):
    xs_lines = []
    ys_lines = []

    xs_rect = []
    ys_rect = []
    width_rect = []
    height_rect = []
    for c in fig.get_axes()[0]._children:
        if isinstance(c, matplotlib.lines.Line2D):
            xs_lines.extend(list(c._x))
            ys_lines.extend(list(c._y))
        elif isinstance(c, matplotlib.patches.Rectangle):
            xs_rect.append(c._x0)
            ys_rect.append(c._y0)
            width_rect.append(c._width)
            height_rect.append(c._height)
    return {'lines': {'xs': sorted(xs_lines),
                      'ys': sorted(ys_lines)},
            'bp': {'xs': sorted(xs_rect),
                   'ys': sorted(ys_rect),
                   'widths': sorted(width_rect),
                   'heights': sorted(height_rect)}}


