    def tearDown(self):
        pass

    def test_read_dotplot(self):
        exp_seq = 'UGACGUUGACUGAUGCGUGUACUGGUAUCGGUAUGCUGACUGAUGC'
        obs_bp, obs_seq = read_dotplot(self.fp_dot1)
        self.assertEqual(exp_seq, obs_seq)
        self.assertEqual(self.exp_bp1,
                         obs_bp.to_string(index_names=False, header=False))

        exp_seq = 'UGACGUUGACaaaUGCGUGUACUGGUAUCGGUAUGCUGACUGAUGC'
        obs_bp, obs_seq = read_dotplot(self.fp_dot2, omit_MEA=False)
        self.assertEqual(exp_seq, obs_seq)
        self.assertEqual(self.exp_bp2, obs_bp.iloc[:10, :].to_string(
                         index_names=False, header=False))

        exp_seq = ("GGGCCCGUAGCACAGUGGA__AGAGCACAUGCCUUCCAACCA_GAUGUCCCG"
                   "GGUUCGAAUCCAGCCGAGCCCA")
        obs_bp, obs_seq = read_dotplot(self.fp_dot_ali)
        self.assertEqual(exp_seq, obs_seq)
        self.assertEqual(self.exp_ali, obs_bp.iloc[:10, :].to_string(
                         index_names=False, header=False))

    def test_dotPlot(self):
        bp_ref, seq_ref = read_dotplot(self.fp_dot1)
        bp_mut, seq_mut = read_dotplot(self.fp_dot2)

        obs = dotPlot(bp_ref, seq_ref)
        self.assertEqual(self.exp_plot_ref, dpElements(obs))

        obs = dotPlot(bp_ref, seq_ref, bp_mut, seq_mut)
        self.assertEqual(self.exp_plot_mut, dpElements(obs))


